extern crate bn;
mod serialization;

use bn::*;
use self::serialization::*;

#[test]
fn serialization_and_deserialization() {
    {
        let mut a = Fr::one();
        let b = Fr::from_str("17").unwrap();

        for _ in 0..10000 {
            a = a * b;

            assert_eq!(reserialize(a), a);
        }
    }
    {
        let mut a = Fq::one();
        let b = Fq::from_str("17").unwrap();

        for _ in 0..10000 {
            a = a * b;

            assert_eq!(reserialize(a), a);
        }
    }
}

#[test]
fn test_invalid_representations() {
    // Fr
    {
        // modulus - 1 is representable
        from_hex::<Fr>("30644e72e131a029b85045b68181585d2833e84879b9709143e1f593f0000000").unwrap();

        // modulus is not representable
        assert!(from_hex::<Fr>("30644e72e131a029b85045b68181585d2833e84879b9709143e1f593f0000001").is_none());

        // ridiculously large numbers
        assert!(from_hex::<Fr>("f0644e72e131a029b85045b68181585d2833e84879b9709143e1f593f0000001").is_none());
        assert!(from_hex::<Fr>("ffffffffffffffffffffffffffffffffffffffffffffffff0000000000000000").is_none());
    }

    // Fq
    {
        // modulus - 1 is representable
        from_hex::<Fq>("30644e72e131a029b85045b68181585d97816a916871ca8d3c208c16d87cfd46").unwrap();

        // modulus is not representable
        assert!(from_hex::<Fq>("30644e72e131a029b85045b68181585d97816a916871ca8d3c208c16d87cfd47").is_none());

        // ridiculously large numbers
        assert!(from_hex::<Fq>("f0644e72e131a029b85045b68181585d97816a916871ca8d3c208c16d87cfd47").is_none());
        assert!(from_hex::<Fq>("ffffffffffffffffffffffffffffffffffffffffffffffff0000000000000000").is_none());
    }
}

